import React, {useState} from 'react';
import List from "./components/List";
import "./styles/app.css"
import Login from "./components/Login";

const App = () => {
    const [isAuth, setIsAuth] = useState(false);
    const [countUsers, setCountUsers] = useState(2);
    const [loginId, setLoginId] = useState(null);
    const [users, setUsers] = useState([
        {id: 1, email: "213@mail.ru", password: "123123"}
    ]);

    return(
        <div>
            {isAuth ?
                <List setIsAuth={setIsAuth} loginId={loginId} setLoginId={setLoginId} users={users}/>
                :
                <Login countUsers={countUsers} setLoginId={setLoginId} setCountUsers={setCountUsers} users={users} setIsAuth={setIsAuth} setUsers={setUsers}/>
            }
        </div>
    );
};

export default App;
